import React from 'react';
import { TaskProvider } from './components/TaskContext'

import Nav from './components/Nav';
import TaskList from './components/TaskList';
import './styles/App.css';
import Weather from './components/Weather';

function App() {
    return (
        <TaskProvider>
            <div className="App">
                <Nav />
                <div id="left">
                    <TaskList />
                </div>
                <div id="right">
                    <Weather />
                </div>
            </div>
        </TaskProvider>
    );
}

export default App;
